import React from 'react';
import { useNavigate } from 'react-router-dom';
// Standard Lucide icons for a professional Android look
import { 
  ChevronRight, 
  UserCircle, 
  Lock, 
  Settings, 
  LogOut, 
  ArrowLeft 
} from 'lucide-react';

const Profile = ({ user }) => {
  const navigate = useNavigate(); // This is required for buttons to work!

  // Menu configuration matching your design images
  const menuItems = [
    { 
      icon: <UserCircle size={20} />, 
      label: "Edit Profile", 
      path: "/edit-profile", 
      color: "#5c5cfc" 
    },
    { 
      icon: <Lock size={20} />, 
      label: "Change Password", 
      path: "/change-password", 
      color: "#5c5cfc" 
    },
    { 
      icon: <Settings size={20} />, 
      label: "Settings", 
      path: "/settings", 
      color: "#5c5cfc" 
    },
  ];

  return (
    <div style={styles.container}>
      {/* Top Navigation Bar */}
      <div style={styles.header}>
        <ArrowLeft 
          size={24} 
          onClick={() => navigate(-1)} 
          style={{ cursor: 'pointer' }} 
        />
        <h2 style={styles.headerTitle}>Profile</h2>
        <div style={{ width: 24 }}></div> {/* Spacer for alignment */}
      </div>

      {/* User Branding Card */}
      <div style={styles.profileCard}>
        <div style={styles.avatarWrapper}>
          <img 
            src="https://images.unsplash.com/photo-1494790108377-be9c29b29330?w=150" 
            alt="User Avatar" 
            style={styles.avatar} 
          />
        </div>
        <h3 style={styles.name}>{user.name}</h3>
        <p style={styles.email}>{user.email}</p>
        <span style={styles.badge}>Student</span>
      </div>

      {/* Academic Information Box */}
      <div style={styles.infoBox}>
        <div style={styles.infoRow}>
          <span style={styles.label}>College Name</span>
          <span style={styles.value}>{user.college}</span>
        </div>
        <div style={styles.infoRow}>
          <span style={styles.label}>Register Number</span>
          <span style={styles.value}>{user.regNo}</span>
        </div>
      </div>

      {/* Interactive Menu List */}
      <div style={{ marginTop: '20px' }}>
        {menuItems.map((item, index) => (
          <div 
            key={index} 
            style={styles.menuItem} 
            onClick={() => navigate(item.path)} // Correctly handles navigation!
          >
            <div style={{...styles.iconBox, color: item.color}}>{item.icon}</div>
            <span style={styles.menuText}>{item.label}</span>
            <ChevronRight size={18} color="#cbd5e1" />
          </div>
        ))}
        
        {/* Logout Button */}
        <div style={styles.menuItem} onClick={() => alert("Logging out...")}>
          <div style={{...styles.iconBox, backgroundColor: '#fff1f2', color: '#ef4444'}}>
            <LogOut size={20} />
          </div>
          <span style={{...styles.menuText, color: '#ef4444'}}>Logout</span>
          <ChevronRight size={18} color="#cbd5e1" />
        </div>
      </div>
    </div>
  );
};

// Inline CSS styles to achieve the Android-native aesthetic
const styles = {
  container: { 
    padding: '20px', 
    paddingBottom: '100px', 
    backgroundColor: '#f8fafc', 
    minHeight: '100vh' 
  },
  header: { 
    display: 'flex', 
    justifyContent: 'space-between', 
    alignItems: 'center', 
    marginBottom: '20px' 
  },
  headerTitle: { fontSize: '18px', fontWeight: 'bold', margin: 0 },
  profileCard: { 
    backgroundColor: '#fff', 
    borderRadius: '24px', 
    padding: '30px 20px', 
    textAlign: 'center', 
    boxShadow: '0 10px 15px -3px rgba(0,0,0,0.05)' 
  },
  avatarWrapper: { 
    width: '90px', 
    height: '90px', 
    borderRadius: '50%', 
    border: '2px solid #5c5cfc', 
    margin: '0 auto', 
    padding: '4px' 
  },
  avatar: { 
    width: '100%', 
    height: '100%', 
    borderRadius: '50%', 
    objectFit: 'cover' 
  },
  name: { fontSize: '20px', fontWeight: 'bold', margin: '15px 0 5px 0' },
  email: { color: '#94a3b8', fontSize: '13px', margin: '0 0 12px 0' },
  badge: { 
    backgroundColor: '#5c5cfc', 
    color: '#fff', 
    padding: '4px 15px', 
    borderRadius: '20px', 
    fontSize: '12px', 
    fontWeight: 'bold' 
  },
  infoBox: { 
    backgroundColor: '#fff', 
    borderRadius: '16px', 
    padding: '16px', 
    marginTop: '20px', 
    border: '1px solid #f1f5f9' 
  },
  infoRow: { 
    display: 'flex', 
    justifyContent: 'space-between', 
    fontSize: '12px', 
    marginBottom: '10px' 
  },
  label: { color: '#94a3b8' },
  value: { fontWeight: 'bold', color: '#1e293b' },
  menuItem: { 
    display: 'flex', 
    alignItems: 'center', 
    backgroundColor: '#fff', 
    padding: '12px 16px', 
    borderRadius: '16px', 
    marginBottom: '10px', 
    border: '1px solid #f1f5f9', 
    cursor: 'pointer' 
  },
  iconBox: { 
    backgroundColor: '#f0f7ff', 
    padding: '8px', 
    borderRadius: '12px' 
  },
  menuText: { 
    flex: 1, 
    marginLeft: '12px', 
    fontSize: '14px', 
    fontWeight: '600' 
  }
};

export default Profile;
